B.JH=new A.be("he responded, \u201cyeah man that\u2019s why when i\u2019m at work i just pull the barricade up and turn it off because it is so bad, keep practicing though, you\u2019ll get better at it you have a good night\u201d",null,null,B.p,null)
B.Ju=new A.be("his response gave me what is perhaps one of the most obvious, boring realizations, nonetheless a big one for me.",null,null,B.p,null)
B.JB=new A.be("i\u2019ve always thought that it is the sensor, the object, that has a perpetually fixed, low p parameter value (\u201csuccess rate\u201d), but his notion that if you practice you\u2019ll somehow \u201cget better at it\u201d prompted me to re-define the framework \u2014 the sensor does not necessarily have to have a perpetually fixed, low p parameter value, but really, each individual has their own p (success rate)!",null,null,B.p,null)
B.K2=new A.be("what if it\u2019s the other way? what if it truly is each individual having their distinct success rates due to difference in \u201cwaving skill\u201d, strength of magnet in parking pass, or for whatever reason?",null,null,B.p,null)
B.Jx=new A.be("i truly had not thought of it that way. i was very comfortable in my head to think and conclude from the very beginning that the sensor was just a very bad one with a low success rate, but it very much could be that every individual has their unique p (\u201csuccess rate\u201d), which completely overthrows my previous belief of \u201cthe sensor is bad, it is what it is\u201d and imbues this new belief of \u201ci do not know if the sensor is good or bad, but whether it takes 30 seconds or 90 seconds is up to me\u201d",null,null,B.p,null)
B.Jv=new A.be("sure, in reality, it is probably a combination of both how good the sensor is and how good an individual\u2019s \u201cwaving skill/angle\u201d is, but his short response made me think about how many things in daily life i had previously assigned an external p (\u201csuccess rate\u201d) that i do not have control over. ",null,null,B.p,null)
B.K_=new A.be("assigning external p\u2019s on many things in daily life (parking barricade, Amazon Alexa hearing me when i say \u201cAlexa\u201d, trivial things like that) is sure comforting for me, but assigning an internal p, which i have the power to increase over time with, say, practice, was oddly an obvious, yet empowering notion he gave me in that very brief moment.",null,null,B.p,null)
B.JE=new A.be("in that preconceived notion of geometric distribution where X = k+1 such that k is the number of failures until my first success, i can employ a mental model where i can start believing that \u201cp\u201d is up to me, and not up to \u201cworld\u201d. that clearly means that, in that case, i have the power to skew the underlying distribution!",null,null,B.p,null)
B.K0=new A.be("it is a massively trivial situation and a massively trivial, non-riveting-to-some realization i had that day, but it made me think about how many more distributions in daily life (and perhaps in broader \u201clife\u201d) i can start owning and claim (whether it is true or not) that the parameters rather than letting \u201cworld\u201d decide the parameter values.",null,null,B.p,null)
B.JR=new A.be("it was very cool of him to give me that moment of \u201cit is up to you if you believe it\u201d that day at the parking lot entrance. i ended up getting frustrated and still drove to the other gate and got back home that way, but still, it made me want to stop understanding and accepting certain distributions in life and mentally \u201cclaim/own\u201d it.",null,null,B.p,null)
B.Jy=new A.be("i\u2019ll probably remember that moment for a very long time, but i had to write it down here because i did not want to forget.",null,null,B.p,null)
